-- DROP TABLE SUBJECT;
CREATE TABLE SUBJECT (
    ID VARCHAR(32) NOT NULL,
    NAME VARCHAR(512) NOT NULL,
    DISPLAYNAME VARCHAR(2048) NOT NULL,
    PRIMARY KEY (ID)
);
CREATE UNIQUE INDEX SUBJECT_NAME ON SUBJECT(NAME);

