-- DROP TABLE ROLE;
CREATE TABLE ROLE (
    ID VARCHAR(32) NOT NULL,
    NAME VARCHAR(512) NOT NULL,
    DISPLAYNAME VARCHAR(2048) NOT NULL,
    PRIMARY KEY (ID)
);
CREATE UNIQUE INDEX ROLE_NAME ON ROLE(NAME);

