INSERT INTO ROLE (ID,NAME,DISPLAYNAME) VALUES ('m','MANAGER', 'Manager');
INSERT INTO ROLE (ID,NAME,DISPLAYNAME) VALUES ('g','GUEST', 'Guest');

-- DROP TABLE PERMISSION;
CREATE TABLE PERMISSION (
    ID VARCHAR(32) NOT NULL,
    ROLE_ID VARCHAR(32) NOT NULL,
    SUBJECT_ID VARCHAR(32) NOT NULL,
    PRIMARY KEY (ID),
    FOREIGN KEY (ROLE_ID) REFERENCES ROLE(ID) ON DELETE CASCADE,
    FOREIGN KEY (SUBJECT_ID) REFERENCES SUBJECT(ID)
);
CREATE INDEX PERMISSION_ROLE ON PERMISSION(ROLE_ID);
CREATE UNIQUE INDEX PERMISSION_SUBJECT ON PERMISSION(ROLE_ID, SUBJECT_ID);

INSERT INTO PERMISSION (ID,ROLE_ID,SUBJECT_ID) VALUES ('0','m','user');
INSERT INTO PERMISSION (ID,ROLE_ID,SUBJECT_ID) VALUES ('1','m','role');
INSERT INTO PERMISSION (ID,ROLE_ID,SUBJECT_ID) VALUES ('2','m','permission');

-- DROP TABLE USERNAME;
CREATE TABLE USERNAME (
    ID VARCHAR(32) NOT NULL,
    NAME VARCHAR(512) NOT NULL,
    DISPLAYNAME VARCHAR(2048) NOT NULL,
    PASSWORD VARCHAR(1024),
    CODECARD VARCHAR(512),
    ROLE_ID VARCHAR(32) NOT NULL,
    VISIBLE BOOLEAN NOT NULL DEFAULT TRUE,
    ACTIVE BOOLEAN,
    IMAGE BYTEA,
    PRIMARY KEY (ID),
    FOREIGN KEY (ROLE_ID) REFERENCES ROLE(ID)
);
CREATE UNIQUE INDEX USERN_NAME ON USERNAME(NAME);
CREATE UNIQUE INDEX USERN_CODECARD ON USERNAME(CODECARD);

